import React, { useState, useEffect } from 'react';
import './CustomerViewDoctor.css';
import axios from 'axios';

const timeOptions = [
  { id: '8-9', label: '8h - 9h' },
  { id: '9-10', label: '9h - 10h' },
  { id: '10-11', label: '10h - 11h' },
  { id: '13-14', label: '13h - 14h' },
  { id: '15-16', label: '15h - 16h' },
];

function CustomerViewDoctor() {
  const [doctors, setDoctors] = useState([]);
  const [selectedDate, setSelectedDate] = useState('');

  
  const handleDateChange = (e) => {
    setSelectedDate(e.target.value);
  };


  return (
    <div className="customer-view-doctor">
      <div className="time-selection">
        <h2>Chọn thời gian trong ngày</h2>
        <div className="date-input">
          <label htmlFor="date">Ngày:</label>
          <input
            type="date"
            id="date"
            value={selectedDate}
            onChange={handleDateChange}
          />
        </div>
        <div className="time-options">
          {timeOptions.map((option) => (
            <button
              key={option.id}
              className="time-option"
            >
              {option.label}
            </button>
          ))}
        </div>
      </div>
      <div className="doctor-list">
        
      </div>
    </div>
  );
}

export default CustomerViewDoctor;
